--
-- Name: multipuntosconexiones; Type: VIEW; Schema: public; Owner: tortopsc_userdb
--

CREATE VIEW public.multipuntosconexiones AS
 SELECT i.key,
    public.st_astext(public.st_makeline(public.st_makepoint(i.longinicio, i.latinicio), public.st_makepoint(f.longfin, f.latfin))) AS geom
   FROM ( SELECT c.id AS key,
            c.inicioid,
            w.lng AS longinicio,
            w.lat AS latinicio
           FROM (public.conexion c
             JOIN public.waypoints w ON ((c.inicioid = w.id)))) i,
    ( SELECT c.id AS key,
            c.finalid,
            w.lng AS longfin,
            w.lat AS latfin
           FROM (public.conexion c
             JOIN public.waypoints w ON ((c.finalid = w.id)))) f
  WHERE (i.key = f.key);


ALTER TABLE public.multipuntosconexiones OWNER TO tortopsc_userdb;

